components/common/alert-info:
{{#if this '===' 'You have qualified for free shipping'}}
    <div class="alertBox alertBox--info alertBox--success {{#contains (toLowerCase this) 'free shipping'}}alert-free-shipping{{/contains}}">
{{else}}
    <div class="alertBox alertBox--info {{#contains (toLowerCase this) 'free shipping'}}alert-free-shipping{{/contains}}" >
{{/if}}

    <div class="alertBox-column alertBox-icon">
        <i class="icon" aria-hidden="true"><svg><use xlink:href="#icon-alert" /></svg></i>
    </div>
    <p class="alertBox-column alertBox-message">
        <span>{{{this}}}</span>
    </p>
</div>

{{#if cart.show_multiple_address_shipping}}
                            <a class="checkoutMultiple" href="{{urls.checkout.multiple_address}}">
                                {{lang 'cart.preview.checkout_multiple'}}
                            </a>
                        {{/if}}

pages/checkout:
{{#partial "head"}}

{{{ checkout.checkout_head }}}
{{{ stylesheet '/assets/css/optimized-checkout.css' }}}
{{ getFontsCollection }}


<script type="text/javascript">
    window.language = {{{langJson 'optimized_checkout'}}};
</script>

{{{head.scripts}}}

{{/partial}}


{{#partial "page"}}

<!-- Google Tag Manager (noscript) -->
<noscript><iframe src="https://www.googletagmanager.com/ns.html?id=GTM-5398BF"
height="0" width="0" style="display:none;visibility:hidden"></iframe></noscript>
<!-- End Google Tag Manager (noscript) -->

<header class="checkoutHeader optimizedCheckout-header">
    <div class="checkoutHeader-content">
        <h1 class="is-srOnly">{{lang 'checkout.title'}}</h1>
        <h2 class="checkoutHeader-heading">
            <a class="checkoutHeader-link" href="{{urls.home}}">
                {{#if checkout.header_image}}
                    {{#if theme_settings.svg_logo}}
                        <img class="checkoutHeader-logo svg-logo" src="{{cdn 'webdav:img/'}}{{theme_settings.svg_logo}}" alt="{{settings.store_logo.title}}" title="{{settings.store_logo.title}}" width="{{first (split theme_settings.logo_size 'x')}}" height="{{last (split theme_settings.logo_size 'x')}}">
                    {{else}}
                        <img alt="{{settings.store_logo.title}}" class="checkoutHeader-logo" id="logoImage" src="{{ checkout.header_image }}"/>
                    {{/if}}
                {{ else }}
                    <span class="header-logo-text">{{settings.store_logo.title}}</span>
                {{/if}}
            </a>
        </h2>
    </div>
</header>
{{#each checkout.status_messages}}
    {{> components/common/alert-info message}}
{{/each}}


{{{ checkout.checkout_content }}}

{{{ footer.scripts }}}

{{/partial}}

{{> layout/empty}}
